pragma solidity ^0.4.23;

import "../Math/SafeMath.sol";

contract crowdsaleRounding {
    using SafeMath for uint256;

    enum rounds {preICO, ICORound1, ICORound2, ICORound3, ICORound4, preWhitelist, Whitelist}
    enum buyerPermission {publicVestors, privateVestors, developerVestors, AccessDenied}

    struct Round {
        rounds round;
        uint256 startTime;
        uint256 endTime;
        uint256 tokensPerETH;
        uint256 minVestingETH;
        uint256 maxVestingETH;
        uint256 HardcapToken;
        buyerPermission permission;
        bool purchaseAllowed;
    }

    Round[] crowdsaleRounds;

    constructor(
        uint256 cliff,
        uint256 _ETH_USD_RATE
    ) 
    public 
    {
        crowdsaleRounds[0].round = rounds.preWhitelist;
        crowdsaleRounds[0].startTime = now + cliff;
        crowdsaleRounds[0].endTime = crowdsaleRounds[0].startTime + 10 days;
        crowdsaleRounds[0].permission = buyerPermission.AccessDenied;
        crowdsaleRounds[0].HardcapToken = 0;
        crowdsaleRounds[0].purchaseAllowed = false;

        crowdsaleRounds[1].round = rounds.preICO;
        crowdsaleRounds[1].startTime = crowdsaleRounds[0].endTime;
        crowdsaleRounds[1].endTime = crowdsaleRounds[1].startTime + 30 days;
        crowdsaleRounds[1].permission = buyerPermission.privateVestors;
        crowdsaleRounds[1].tokensPerETH = _ETH_USD_RATE.div(8).mul(100);
        crowdsaleRounds[1].minVestingETH = uint256(50e3).div(_ETH_USD_RATE).mul(1 ether);
        crowdsaleRounds[1].maxVestingETH = uint256(120e6).mul(8).div(100).div(_ETH_USD_RATE).mul(1 ether);
        crowdsaleRounds[1].HardcapToken = 120e6;
        crowdsaleRounds[1].purchaseAllowed = true;

        crowdsaleRounds[2].round = rounds.Whitelist;
        crowdsaleRounds[2].startTime = crowdsaleRounds[1].endTime;
        crowdsaleRounds[2].endTime = crowdsaleRounds[2].startTime + 10 days;
        crowdsaleRounds[2].permission = buyerPermission.AccessDenied;
        crowdsaleRounds[2].HardcapToken = 0;
        crowdsaleRounds[2].purchaseAllowed = false;

        crowdsaleRounds[3].round = rounds.ICORound1;
        crowdsaleRounds[3].startTime = crowdsaleRounds[2].endTime;
        crowdsaleRounds[3].endTime = crowdsaleRounds[3].startTime + 1 weeks;
        crowdsaleRounds[3].permission = buyerPermission.publicVestors;
        crowdsaleRounds[3].tokensPerETH = _ETH_USD_RATE.div(12).mul(100);
        crowdsaleRounds[3].minVestingETH = 0.1 ether;
        crowdsaleRounds[3].maxVestingETH = 300 ether;
        crowdsaleRounds[3].HardcapToken = 125e6;
        crowdsaleRounds[3].purchaseAllowed = true;

        crowdsaleRounds[4].round = rounds.ICORound2;
        crowdsaleRounds[4].startTime = crowdsaleRounds[3].endTime;
        crowdsaleRounds[4].endTime = crowdsaleRounds[4].startTime + 1 weeks;
        crowdsaleRounds[4].permission = buyerPermission.publicVestors;
        crowdsaleRounds[4].tokensPerETH = _ETH_USD_RATE.div(13).mul(100);
        crowdsaleRounds[4].minVestingETH = 0.1 ether;
        crowdsaleRounds[4].maxVestingETH = 300 ether;
        crowdsaleRounds[4].HardcapToken = 125e6;
        crowdsaleRounds[4].purchaseAllowed = true;

        crowdsaleRounds[5].round = rounds.ICORound3;
        crowdsaleRounds[5].startTime = crowdsaleRounds[4].endTime;
        crowdsaleRounds[5].endTime = crowdsaleRounds[5].startTime + 1 weeks;
        crowdsaleRounds[5].permission = buyerPermission.publicVestors;
        crowdsaleRounds[5].tokensPerETH = _ETH_USD_RATE.div(14).mul(100);
        crowdsaleRounds[5].minVestingETH = 0.1 ether;
        crowdsaleRounds[5].maxVestingETH = 300 ether;
        crowdsaleRounds[5].HardcapToken = 125e6;
        crowdsaleRounds[5].purchaseAllowed = true;

        crowdsaleRounds[6].round = rounds.ICORound4;
        crowdsaleRounds[6].startTime = crowdsaleRounds[5].endTime;
        crowdsaleRounds[6].endTime = crowdsaleRounds[6].startTime + 1 weeks;
        crowdsaleRounds[6].permission = buyerPermission.publicVestors;
        crowdsaleRounds[6].tokensPerETH = _ETH_USD_RATE.div(15).mul(100);
        crowdsaleRounds[6].minVestingETH = 0.1 ether;
        crowdsaleRounds[6].maxVestingETH = 300 ether;
        crowdsaleRounds[6].HardcapToken = 125e6;
        crowdsaleRounds[6].purchaseAllowed = true;
    }

    function getRoundIndex() public view OnlyWhileCrowdsaleNotTimedout returns (uint8) {
        for(uint8 i=0; i < crowdsaleRounds.length; i++) {
            if (now > crowdsaleRounds[i].startTime && now < crowdsaleRounds[i].endTime) {
                return i;
            }
        }
    }

    function getCrowdsaleRound() public view OnlyWhileCrowdsaleNotTimedout returns (rounds) {
        for(uint8 i=0; i < crowdsaleRounds.length; i++) {
            if (now > crowdsaleRounds[i].startTime && now < crowdsaleRounds[i].endTime) {
                return crowdsaleRounds[i].round;
            }
        }
    }

    function getPermission() public view returns (buyerPermission) {
        uint8 roundIndex = getRoundIndex();
        return crowdsaleRounds[roundIndex].permission;
    }

    function getTokenPerETH() public view returns (uint256) {
        uint8 roundIndex = getRoundIndex();
        return crowdsaleRounds[roundIndex].tokensPerETH;
    }

    function getMinVestingETH() public view returns (uint256) {
        uint8 roundIndex = getRoundIndex();
        return crowdsaleRounds[roundIndex].minVestingETH;
    }

    function getMaxVestingETH() public view returns (uint256) {
        uint8 roundIndex = getRoundIndex();
        return crowdsaleRounds[roundIndex].maxVestingETH;
    }

    function isPurchaseAllowed() public view returns (bool) {
        uint8 roundIndex = getRoundIndex();
        return crowdsaleRounds[roundIndex].purchaseAllowed;
    }

    function getTimedHardcapToken() public view returns (uint256) {
        uint8 roundIndex = getRoundIndex();
        uint256 hardCap;
        for (uint8 i = 0; i < roundIndex; i++) {
            if (crowdsaleRounds[i].purchaseAllowed) {
                hardCap = hardCap.add(crowdsaleRounds[i].HardcapToken);
            }
        }
        return hardCap;
    }

    modifier onlyWhilePurchaseAllowed() {
        require(isPurchaseAllowed());
        _;
    }

    modifier OnlyWhileCrowdsaleNotTimedout() {
        require(now > crowdsaleRounds[0].startTime && now < crowdsaleRounds[crowdsaleRounds.length-1].endTime);
        _;
    }
}
